(10553, 99, 1213, 10, '透明紀錄(Record Invisible)', '', '2008-12-19 00:00:00', 0000, 15, 0, 7, '', '詞/曲：鐘禮學 \n\n最後一班車 跌入湛藍的頻率 \n我們都困在回憶中的霧 \n\n垃圾堆尋找 胡言亂語的道理 \n在箱子裡面缺了頁的書 \n\n一直重複走的路 今天晚上怎麼會 找不到 \n\n是我錯了路 \n還是這裡 短暫的透明 遺忘 \n\n\n\n時間都靜止在 凍結的森林 \n時間都靜止在 透明的絢暈 \n我們都靜止在 莫名的悲喜 \n時間都靜止在 透明的絢暈 \n\n\n*紀錄開始 從頭開始 \n記憶開始 從頭開始 ', 380, '', '', '', '', '', '', 1, 1, 0, '2008-12-22 17:06:36', '2015-03-12 13:35:45', '0000-00-00 00:00:00'),
(10554, 99, 1213, 11, '捉迷藏(Hide-and-Seek)', '', '2008-12-19 00:00:00', 0000, 15, 0, 7, '', '捉迷藏\n\n詞/曲：鐘禮學\n\nHey～用你的方法\nRun and run 逃離這城堡\nHey～用你的方法\nHide and hide 躲避著過往\n\n後來發現 還有一個 小房間\n後來發現 在手心裡 鑽了洞\n\nHey～用你的力量\nCry and cry 哭泣這迷惘\nHey～用力的妄想\nFly and fly 直到最後啊\n\n後來發現 還有一個 小房間\n再過一秒 就能抱緊 一整眠', 187, '', '', '', '', '', '', 1, 1, 0, '2008-12-22 17:06:52', '2015-03-12 13:35:45', '0000-00-00 00:00:00'),
